import React , {Component} from 'react'
import { BrowserRouter, Route} from 'react-router-dom';
import Nav from './Nav'

class App extends Component{
    render(){
        return(
            <BrowserRouter>
                <div className='App'>
                    <Nav />
                </div>
            </BrowserRouter>
        );
    }
}

export default App;
